function planeFire() {
  plane1.src = plane1Fire;
  setTimeout(function() {
    plane1.src = plane1Source;
  },500);
}

function rotateThis(elem,degrees) {
  elem.style.webkitTransform = 'rotate('+degrees+'deg)'; 
  elem.style.mozTransform    = 'rotate('+degrees+'deg)'; 
  elem.style.msTransform     = 'rotate('+degrees+'deg)'; 
  elem.style.oTransform      = 'rotate('+degrees+'deg)'; 
  elem.style.transform       = 'rotate('+degrees+'deg)'; 
}

function fadeOut(elemID) {
  var elem = document.getElementById(elemID);
  if (elem) {
    var opacity = parseFloat(window.getComputedStyle(elem).getPropertyValue("opacity")) || 0;
    if (opacity > 0.1) {
      elem.style.opacity = opacity - 0.1;
      setTimeout(function() { fadeOut(elemID); }, 50);
    } else {
      elem.style.display = 'none';
    }
  }
}

var backgroundPosition = 100;
function draw () {
  backgroundPosition -= 1;
  document.getElementById('JSE-captcha-game-container').style.backgroundPosition = backgroundPosition+'px 0px';
  plane1.style.top = plane1.yAxis+'px';
  plane1.style.left = plane1.xAxis+'px';
  zeplin1.xAxis += 1;
  if (zeplin1.xAxis >= 270) zeplin1.xAxis = 0;
  zeplin1.style.top = zeplin1.yAxis+'px';
  zeplin1.style.left = zeplin1.xAxis+'px';
  zeplin2.xAxis += 2;
  if (zeplin2.xAxis >= 270) zeplin2.xAxis = 0;
  zeplin2.style.top = zeplin2.yAxis+'px';
  zeplin2.style.left = zeplin2.xAxis+'px';
  zeplin2.rotation -= 3;
  zeplin3.xAxis += 3;
  if (zeplin3.xAxis >= 270) zeplin3.xAxis = 0;
  zeplin3.style.top = zeplin3.yAxis+'px';
  zeplin3.style.left = zeplin3.xAxis+'px';
}

var update = setInterval(function(draw1) {
  draw1();
}, 100,draw);

